import { FuseLoadable } from 'owp/@fuse';

export const C801000Config = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes: [
        {
            path: '/pages/C801000',
            component: FuseLoadable({
                loader: () => import('./C801000')
            })
        }
    ]
};
